
function LoggedMasterPage(){$(".top-avatar-container .user-avatar").popover({content:function(){return $(".user-bar").html()},html:true})}LoggedMasterPage.prototype.toggleMenu=function(){var a=$("#left-column");if(a.hasClass("hidden-xs")||a.hasClass("hidden-sm")){a.removeClass("hidden-xs");a.removeClass("hidden-sm");$("#MenuDarkSide").show()}else{a.addClass("hidden-xs");a.addClass("hidden-sm");$("#MenuDarkSide").hide()}};$(function(){var a=new LoggedMasterPage();$("#toggle_menu, #MenuDarkSide").click(function(){a.toggleMenu()})});